import logo from './logo.svg';
import './App.scss';
import { Routes } from 'react-router-dom';
import Home from './pages/Home/Home';
import Work from './pages/Work/Work';


function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home/>}></Route>
        <Route path="/Work" element={<Work/>}></Route>
      </Routes>
    </div>
  );
}

export default App;
